import './App.css';
import Nav from './Nav/Nav';
import Home from './Home/Home';

function App() {

  const [userData, setUserData] = useState([]);
  const getUserData = () => {
    axios
      .get()
      .then(res => {
        setData(res.data);
      })
      .catch(err => {
        console.log(err);
      })
  }


  return (
    <div className="App">
      <Nav className='nav'/>
      <Home className='home'/>
    </div>
  );
}

export default App;
